    @PostMapping("/asetest")
    public String asetest(String value) throws Exception {
        String key = "asdsdfs112323242";
        String encryptString = aesUtil.aesEncryptToBytes(value, key);
        logger.info(String.format("加密后的信息: [%s]", encryptString));
        String EncrytString = aesUtil.desEncryt(encryptString, key);
        logger.info(String.format("解密后的信息: [%s]", EncrytString));
        return "success";
    }

    @PostMapping("/asejia")
    public String asejia(String value) throws Exception {
        String key = "abcdefgabcdefg12";
        String encryptString = aesUtil.aesEncryptToBytes(value, key);
        logger.info(String.format("加密后的信息: [%s]", encryptString));
        return encryptString;
    }

    @PostMapping("/asejie")
    public String asejie(String value) throws Exception {
        String key = "abcdefgabcdefg12";
        String encryptParam = URLDecoder.decode(value, "UTF-8");
        if (encryptParam != null && !"".equals(encryptParam)) {
            if (encryptParam.endsWith("=")) {
                encryptParam = encryptParam.substring(0, encryptParam.length() - 1);
            }
            if (encryptParam.contains(" ")) {
                encryptParam = encryptParam.replace(" ", "+");
            }
        }

        String EncrytString = aesUtil.desEncryt(encryptParam, key);
        logger.info(String.format("解密后的信息: [%s]", EncrytString));
        return EncrytString;
    }
